import './App.css';

function App() {
  return (
    <div className="App">
      <h1 className='greetings'>Rui Melo</h1>
      <div className='circle'>
        <div className='circle-outter'>
          <p>About</p>
          <p>Projects</p>
          <p>CV</p>
        </div>
        <div className='circle-inner'></div>
      </div>
    </div>
  );
}

export default App;
